import React from "react";
import {StyleSheet} from 'react-native';

const darkMode = StyleSheet.create({
    card: {
        flex: 1,
        justifyContent: "center",
        width: "100%",
        backgroundColor:"#000",
        color: "#fff",
      },

});

export default darkMode;
